response.interests:
СФЕРЫ ПРОФЕССИОНАЛЬНЫХ ИНТЕРЕСОВ:
• функционирование психических процессов;
• взаимовлияние психических, биологических и социальных систем и условий;
• психическая/психологическая устойчивость и антихрупкость;
• личная, социальная реализация - явление себя;
• социальные устройства;
• искренности и непротиворечие;
• ресурсность, жизненная энергия и жизнетворчество.

ИНТЕРЕСЫ:
• Природа, возможности и преображение
человека, достоинство, сила духа, психология, философия, науки, духовность, системный кругозор;
• Познание, развитие, совершенствование (себя и мира вокруг);
• Самостоятельные путешествия, экспедиции, велосипед, активный отдых;
• Коммуникации, переговоры, международные связи;
• Лингвистика, иностранные языки, чистота речи и языка, сила слова и голоса;
• Здоровье и сила: тела, души, духа.
